webpackJsonp([0x950e4d709580],{8276:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Toys",date:"28 Jun 2006",slug:"/2006-06-28-toys/",tags:"Y2006"},html:'<p><a href="http://www.flickr.com/photos/papascott/177175128/" title="Photo Sharing"><img src="http://static.flickr.com/44/177175128_ac093a8782.jpg" width="500" height="452" alt="IMG 1524" /></a></p>\n<p>The white one is mine, the black one is MamaMaus\'. Christopher went empty today.</p>\n<p>For all the complaining I did, the MacBook arrived on the exact day Apple estimated delivery. It doesn\'t whine, it doesn\'t moo, and it\'s not too hot.</p>\n<p>MamaMaus\' employer is rolling out Blackberries throughout Europe. She\'s been used to replicating Lotus Notes on her notebook. Her first comment: "This is easy. You mean I don\'t have to sync it?"</p>'},next:{fields:{title:"Holiday on Ice",date:"26 Jun 2006",slug:"/2006-06-26-holiday-on-ice/"}},previous:{fields:{title:"Don't Get Naked",date:"01 Jul 2006",slug:"/2006-07-01-dont-get-naked/"}}},{node:{fields:{title:"Holiday on Ice",date:"26 Jun 2006",slug:"/2006-06-26-holiday-on-ice/",tags:"Y2006"},html:'<p><a href="http://www.spreeblick.com/2006/06/26/eishockey/"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2006/06/por_ned.jpg" alt="Por Ned" /></a></p>\n<p><a href="http://www.spreeblick.com/2006/06/26/eishockey/">Spreeblick</a> asks if the World Cup fiasco last night between <a href="http://www.spreeblick.com/2006/06/26/eishockey/">Portugal and Holland</a> was perhaps ice hockey instead of a soccer match.</p>\n<p>I doubt it. I\'ve never seen an ice hockey game as dirty as that, or with such poor officiating.</p>'},next:{fields:{title:"Web Design Explained",date:"23 Jun 2006",slug:"/2006-06-23-web-design-explained/"}},previous:{fields:{title:"Toys",date:"28 Jun 2006",slug:"/2006-06-28-toys/"}}},{node:{fields:{title:"Web Design Explained",date:"23 Jun 2006",slug:"/2006-06-23-web-design-explained/",tags:"Y2006"},html:'<p>This <a href="http://poisonedminds.com/comics/pm20060621.png" title="Time Breakdown of Modern Web Design">pie chart</a> explains in terms even a <a href="http://en.wikipedia.org/wiki/Pointy_Haired_Boss">pointy-haired</a> manager can understand why web design takes so much longer than is planned. It also explains why the designers are sometimes so surly to the sys admins. (via <a href="http://www.2020hindsight.org/2006/06/21/designing-web-sites-how-much-time-is-spent-on-each-task/">2020 Hindsight</a>)</p>'},next:{fields:{title:"Wave If You See Us",date:"22 Jun 2006",slug:"/2006-06-22-wave-if-you-see-us/"}},previous:{fields:{title:"Holiday on Ice",date:"26 Jun 2006",slug:"/2006-06-26-holiday-on-ice/"}}}],pathPrefix:"",first:!1,last:!1,index:212,pageCount:1101}}}});
